    DECLARE v_code_postal_garant VARCHAR(255);
    DECLARE v_ville_garant VARCHAR(255);
    DECLARE v_pays_garant VARCHAR(255);
    DECLARE v_tel1_garant VARCHAR(45);
    DECLARE v_tel2_garant VARCHAR(45);
	DECLARE v_tel_bureau VARCHAR(45);
    DECLARE v_email_garant VARCHAR(255);
    DECLARE v_profession_garant VARCHAR(255);
    DECLARE v_revenus_mensuels_garant INT;
