    DECLARE v_cin_client VARCHAR(45);
    DECLARE v_new_ref_contrat VARCHAR(255);
    DECLARE v_random_num INT;
    DECLARE v_found_dossier_id INT DEFAULT NULL;
    
    DECLARE v_nom_client VARCHAR(255);
    DECLARE v_prenom_client VARCHAR(255);
    DECLARE v_cin VARCHAR(255);
    DECLARE v_date_naissance_client DATE;
    DECLARE v_lieu_naissance_client VARCHAR(255);
    DECLARE v_situation_familiale_client VARCHAR(255);
    DECLARE v_adresse_client TEXT;
    DECLARE v_code_postal_client VARCHAR(45);
    DECLARE v_ville_client VARCHAR(45);
    DECLARE v_pays_client VARCHAR(45);
    DECLARE v_tel_1_client VARCHAR(45);
    DECLARE v_tel_2_client VARCHAR(45);
    DECLARE v_email_client VARCHAR(255);

    -- Fetch necessary data from demande_logement
    SELECT id_client, nom, prenom, cin_client, date_naissance, lieu_naissance,
           situation_familiale, adresse_client, code_postal_client, ville_client,
           pays_client, tel_1_client, tel_2_client, email_client, nom_garant, prenom_garant, 
           cin_garant, date_naissance_garant, lieu_naissance_garant, situation_familiale_garant,
           adresse_garant, code_postal_garant, ville_garant, pays_garant, tel1_garant, 
           tel2_garant, tel_bureau, email_garant, profession, revenus_mensuels, id_unite_location, 
           cin_client INTO 
           v_id_client, v_nom_client, v_prenom_client, v_cin, v_date_naissance_client, v_lieu_naissance_client,
           v_situation_familiale_client, v_adresse_client, v_code_postal_client, v_ville_client,
           v_pays_client, v_tel_1_client, v_tel_2_client, v_email_client, v_nom_garant, v_prenom_garant,
           v_cin_garant, v_date_naissance_garant, v_lieu_naissance_garant, v_situation_familiale_garant,
           v_adresse_garant, v_code_postal_garant, v_ville_garant, v_pays_garant, v_tel1_garant, 
           v_tel2_garant, v_tel_bureau, v_email_garant, v_profession_garant, v_revenus_mensuels_garant, v_id_unite_location,
           v_cin_client
    FROM demande_logement
    WHERE id = id_demande_logement;

    -- Check if dossier_location already exists
    SELECT id INTO v_found_dossier_id
    FROM dossier_location
    WHERE id_client = v_id_client;

    IF v_found_dossier_id IS NOT NULL THEN
        -- If found, return the existing dossier ID
        SELECT v_found_dossier_id;
    ELSE
        -- Create a new garant
        VALUES (CONCAT('Garant_', v_cin_garant), CONCAT(v_nom_garant, ' ', v_prenom_garant), 'gerant', v_cin_garant, CONCAT(v_adresse_garant, ', ', v_code_postal_garant, ', ', v_ville_garant, ', ', v_pays_garant), 'rc', 'patente', v_tel1_garant, v_tel2_garant, v_tel_bureau, v_email_garant, 'compte_bancaire', v_profession_garant, v_revenus_mensuels_garant, NOW(), NOW());


        SET v_id_garant = LAST_INSERT_ID();

        -- Update client record
        UPDATE client
        SET nom_prenom = CONCAT(v_nom_client, ' ', v_prenom_client), cin = v_cin, 
            date_naissance = v_date_naissance_client, lieu_naissance = v_lieu_naissance_client,
            situation_familiale = v_situation_familiale_client, adresse = CONCAT(v_adresse_client, ', ', v_code_postal_client, ', ', v_ville_client, ', ', v_pays_client),
            tel1 = v_tel_1_client, tel2 = v_tel_2_client, mail = v_email_client
        WHERE id = v_id_client;

        -- Create a new garantie record
        VALUES (v_id_garant, v_id_client, NOW(), NOW());

        -- Create a new contrat
        SET v_random_num = FLOOR(RAND() * 99999);
        SET v_new_ref_contrat = CONCAT(v_cin_client, '_', DATE_FORMAT(NOW(), '%Y%m%d'), '_', v_random_num);
        VALUES (v_new_ref_contrat, NOW(), NOW(), NOW());

        SET v_id_contrat = LAST_INSERT_ID();

        -- Create a new dossier_location
        VALUES (NOW(), v_id_client, v_id_unite_location, v_id_contrat, NOW(), NOW());

        -- Return the newly created dossier_location ID
        SELECT LAST_INSERT_ID();
    END IF;
END$$

